Console.WriteLine($"Input length: {testCode.Length}");
Console.WriteLine($"First 50 chars: {testCode.Substring(0, Math.Min(50, testCode.Length))}");

// Clean whitespace
testCode = new string(testCode.Where(c => !char.IsWhiteSpace(c)).ToArray());
Console.WriteLine($"After cleaning: {testCode.Length} chars");

// Convert URL-safe Base64
testCode = testCode.Replace('-', '+').Replace('_', '/');

// Add padding
int padding = testCode.Length % 4;
if (padding > 0)
{
    testCode += new string('=', 4 - padding);
}

// Decode Base64
byte[] compressedBytes = Convert.FromBase64String(testCode);
Console.WriteLine($"Decoded bytes: {compressedBytes.Length}");
Console.WriteLine($"First 10 bytes: {BitConverter.ToString(compressedBytes.Take(10).ToArray())}");

// Try decompress
try
{
    using var compressedStream = new System.IO.MemoryStream(compressedBytes, 2, compressedBytes.Length - 2);
    using var deflateStream = new System.IO.Compression.DeflateStream(compressedStream, System.IO.Compression.CompressionMode.Decompress);
    using var resultStream = new System.IO.MemoryStream();
    
    deflateStream.CopyTo(resultStream);
    
    string xml = System.Text.Encoding.UTF8.GetString(resultStream.ToArray());
    
    Console.WriteLine("✓ SUCCESS!");
    Console.WriteLine($"XML length: {xml.Length}");
    Console.WriteLine($"Has <PathOfBuilding>: {xml.Contains("<PathOfBuilding>")}");
}
catch (Exception ex)
{
    Console.WriteLine($"✗ ERROR: {ex.Message}");
}
